import React from 'react';

export default function Teams() {
    // Array of team data (replace these with your actual team data)
    const teams = [
        { id: 1, name: 'Team 1', image: 'images/kkr.jpg', link: '/team1' },
        { id: 2, name: 'Team 2', image: 'team2_logo.png', link: '/team2' },
        { id: 3, name: 'Team 3', image: 'team3_logo.png', link: '/team3' },
        { id: 4, name: 'Team 4', image: 'team4_logo.png', link: '/team4' },
        { id: 5, name: 'Team 5', image: 'team5_logo.png', link: '/team5' },
        { id: 6, name: 'Team 6', image: 'team6_logo.png', link: '/team6' },
        { id: 7, name: 'Team 7', image: 'team7_logo.png', link: '/team7' },
        { id: 8, name: 'Team 8', image: 'team8_logo.png', link: '/team8' },
        { id: 9, name: 'Team 9', image: 'team9_logo.png', link: '/team9' },
        { id: 10, name: 'Team 10', image: 'team10_logo.png', link: '/team10' },
    ];

    return (
        <section id="teams" className="teams-section">
            <div className="container">
                <h2 className="section-heading">Teams</h2>
                <div className="row">
                    {/* Render team images */}
                    {teams.map((team) => (
                        <div key={team.id} className="col-md-6 col-lg-3">
                            <a href={team.link}>
                                <img
                                    src={team.image}
                                    alt={team.name}
                                    className="team-image"
                                />
                            </a>
                        </div>
                    ))}
                </div>
            </div>
        </section>
    );
}
